import { createApp } from 'vue';
import App from './App.vue';
import router from './routers';
import './registerServiceWorker';
//import 'bootstrap/dist/css/bootstrap.min.css';
//import 'bootstrap';

createApp(App)
    .use(router)
    .mount('#app');
